import React from "react";

const cls = "bg-indigo-700 text-white py-3 px-5 rounded";

const Button = ({ onMouseEnter }) => (
  <button className={cls} onMouseEnter={onMouseEnter}>
    Dropdown button
  </button>
);

export default Button;
